export const styles = theme => ({
    root: {
        borderRadius: "16px 16px 0 0",
        boxShadow: theme.shadows[16],
        maxWidth: "330px",
        padding: theme.spacing(2),
    },
    totalPrice: { display: "block" },
    hotel: { color: theme.palette.hotel.main },
});
